import React from 'react';
import './LandingPage.css';
import NavigationLoadingPage from './NavigationLoadingPage';
import { Navbar, Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button } from 'react-bootstrap';

function LandingPage() {
    return (
        <div className="LandingPage">
            <NavigationLoadingPage />
            <h1 className="titleLandingPage">Anastasia</h1>
            <p>Listen to your music, create your playlists, Share them with others.</p>
            <p>Anastasia is probably the best streaming music platform, you can subscribe or listen for free.</p>
        </div>
    );
}

export default LandingPage;
